import React from "react";
import "./navbar.css";

import logo from '../../assets/logo.svg'

const Navbar = () => {
  return (
    <div className="gpt3__navbar">
      <div className="gpt3__navbar-links">
        <div className="gpt3__navbar-links_logo">
          <img src={logo} alt="logo" />
        </div>
      </div>
      <h1>Malik</h1>
    </div>
  );
};

export default Navbar
